our new apartment in Pudong, one of the first to have flushable toilets, had no elevators or gas infrastructure. instead, we lugged coal brics up to the 4th floor to cook (in the corridors) &amp; heat.

this was 1992 and SHA represented ~20-25% of China's GDP.

